export default {
    buttonStyle : {
        background: 'transparent',
        border: 'none',
        boxShadow: 'none',
        outline: 'none',
        width: '16.6%',
        height: '20%'
    },

    sectionStyle : {
        width: '100%',
        height: '100%',
        display: 'inline-block',
        verticalAlign: 'top',
        whiteSpace: 'normal'
    },

    slideContainer : {
        overflow: 'hidden',
        width: '210px',
        whiteSpace: 'nowrap',
        display: 'inline-block',
        position: 'sticki',
        bottom: '50px',
        transform: '',
    },

    containerStyle : {
        position: 'absolute',
        //display: 'inline-block',
        transform: 'translate(-150px ,-185px)',
        width: '250px',
        height: '130px',
        background: 'white',
        boxSizing: 'content-box',
        padding: '5px',
    },

    sliderNavigationButton:{
        ...this.buttonStyle,
        display: 'inline-block',
        width: '20px',
        height: '100%',
        top: '50%',
        verticalAlign: 'top'
    },

    iconStyle : {
        transform: 'translateX(-25%)',
    }
}
